import React from 'react';

export default class Calculator extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        display: 0
    }
  }

  render() {
    return(
        <div className='calculator'>
          <div className='display'>{this.state.display}</div>
          <div>PPPP</div>
        </div>
    )
  }

}
